import styled from "styled-components";
import React,{useEffect} from 'react'
import { useSelector} from 'react-redux'
import useCheckInAction from '../../hooks/useCheckInAction'
import {RootState} from '../../store/reducers'
import Moment from 'react-moment';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import Pagination from '@material-ui/lab/Pagination';


const LayoutDashboard = styled.div`
  flex: 7 1 0%;
  background-color: rgba(255,214,107,1);
  display: flex;
  flex-direction: column;

`;
interface Data {
  No: number;
  Name: string;
  CheckIn: string;
  CheckOut: string;
  Note: string;

}
function TableTime() {

    const {getTimeOfEmpsToday} = useCheckInAction()
    const emps = useSelector((state: RootState) => state.checkIn.todayEmps)
    const [page, setPage] = React.useState(0);

    const handleChangePage = (event: unknown, newPage: number) => {
      setPage(newPage);
    };


    useEffect(() => {
        getTimeOfEmpsToday();
    }, [getTimeOfEmpsToday])
    console.log("emps emps:", emps)

      return (
        <LayoutDashboard className="h-screen">
          <div className="md:px-10 mt-0.25 py-8 w-full ">
                    <div className="shadow overflow-hidden rounded border-b border-gray-200">
                        <Table className="min-w-full bg-white">
                                <thead className="bg-gray-800 text-white ">
                                <tr>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">No</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">Name</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm"> Check-In</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">Check-Out</th>
                                    <th className="text-left py-3 px-4 uppercase font-semibold text-sm">#Note</th>
                                </tr>
                                </thead>
                            <tbody className="text-gray-700  ">
                              {emps.map((items : any) => {
                                return (
                                        <tr  tabIndex={-1} key={items}>
                                        <TableCell className=" text-left py-3 px-4">#</TableCell> 
                                        <TableCell className=" text-left py-3 px-4">{items.nickName}</TableCell>
                                        <TableCell className="text-left py-3 px-4"><Moment format="hh:mm">{items.checkIn}</Moment></TableCell>
                                        <TableCell className="text-left py-3 px-4"><Moment format="hh:mm">{items.checkOut}</Moment></TableCell>
                                        <TableCell className="text-left py-3 px-4">{items.note}</TableCell>
                                      </tr>
                                      );
                                    })}
                            </tbody>
                        </Table>
                    </div>
                    <DataGrid
                      page={page}
        onPageChange={(params) => {
          setPage(params.page);
        }}
        pageSize={5}
        pagination
        {...data}
      />
                </div>
        </LayoutDashboard>
        )
    }
export default TableTime
